import { Dialog,Box,Typography } from "@mui/material";

const dialogStyle={

    height:'96%',
    marginTop:'12%',
    width:'60%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'none'

}

const LoginDialog = () => {

    return (
        <Dialog 
        open={true}
        PaperProps={{sx: dialogStyle}}
        >
            <Box>
                <Box>
                    <Typography></Typography>

                </Box>

                <Box>

                </Box>
            </Box>
        </Dialog>
    )
}

export default LoginDialog;
